import React, { Component } from 'react';
import BonusItem from './BonusDetailItem';

export class BonusDetails extends Component {
    constructor(props) {
        super(props);
        this.state = {
            items: []
        };
    }

    componentDidMount() {
        this.fetchData();
    }

    fetchData = async () => {
        try {
            const response = await fetch('https://api.adkey-seo.com/api/website/get-website/295');
            if (!response.ok) {
                throw new Error('Failed to fetch data');
            }
            const data = await response.json();
            this.setState({ items: data }); // Assuming data is an array of items
        } catch (error) {
            console.error('Error fetching data:', error);
        }
    };

    render() {
        const { items } = this.state;

        return (
            <section id='bonusDetails' className='bonusDetails'>
                <div className='container'>
                    <h2 className='title h2-text'>Bonus details</h2>
                    <div className='bonusDetails-inner'>
                        <div className='cap row'>
                            <div className='naming'>Casino</div>
                            <div className='bonuses'>Bonuses</div>
                            <div className='rate'>Rate</div>
                            <div className='amaunt'>Max. amount</div>
                            <div className='info'>More info</div>
                            <div className='get link'>Get</div>
                        </div>

                        {items.slice(0, 7).map(el => (
                            <BonusItem key={el.id} item={el} />
                        ))}
                    </div>
                </div>
            </section>
        );
    }
}

export default BonusDetails;
